import React from "react";
import "./App.css";
import ListItem from "./SimpleComponents/ListItem";
import moment from "moment";
import NavBar from "./SimpleComponents/NavBar";
// import Flyer from "./SimpleComponents/Flyer";

function App() {
  const nameList = [
    {
      id: 1,
      name: {
        title: "Mr",
        first: "Brad",
        last: "Gibson",
      },
      location: {
        city: "kilcoole",
      },
      email: "brad.gibson@example.com",
      dob: {
        date: "1993-07-20T09:44:18.674Z",
      },
      picture: {
        medium: "https://randomuser.me/api/portraits/men/75.jpg",
      },
    },

    {
      id: 2,
      name: {
        title: "Mrs",
        first: "Brie",
        last: "Larson",
      },
      location: {
        city: "New York",
      },
      email: "brie.larson@example.com",
      dob: {
        date: "1990-08-23T01:14:28.374Z",
      },
      picture: {
        medium: "https://randomuser.me/api/portraits/women/3.jpg",
      },
    },

    {
      id: 3,
      name: {
        title: "Miss",
        first: "Lee",
        last: "Hang",
      },
      location: {
        city: "Wuhan",
      },
      email: "emaly.blunt@example.com",
      dob: {
        date: "1987-12-22T01:14:28.374Z",
      },
      picture: {
        medium: "https://randomuser.me/api/portraits/women/17.jpg",
      },
    },

    {
      id: 4,
      name: {
        title: "Mr",
        first: "Chris",
        last: "Hemswarth",
      },
      location: {
        city: "Miami",
      },
      email: "chris.hemswarth@example.com",
      dob: {
        date: "1988-01-01T09:44:18.674Z",
      },
      picture: {
        medium: "https://randomuser.me/api/portraits/men/32.jpg",
      },
    },
  ];

  const nameListComponent = () => {
    return nameList.map((card) => {
      return (
        <ListItem
          key={card.id}
          name={`${card.name.title} ${card.name.first} ${card.name.last}`}
          city={card.location.city}
          email={card.email}
          birthday={moment(card.dob.date).format("L")}
          avatar={card.picture.medium}
        />
      );
    });
  };

  return (
    <React.Fragment>
      <div className = "PageColor">
        <NavBar/>
        <div
        id="carouselExampleIndicators"
        className="carousel slide"
        data-ride="carousel"
      >
        <ol className="carousel-indicators">
          <li
            data-target="#carouselExampleIndicators"
            data-slide-to="0"
            className="active"
          ></li>
          <li data-target="#carouselExampleIndicators" data-slide-to="1"></li>
          <li data-target="#carouselExampleIndicators" data-slide-to="2"></li>
        </ol>
        <div className="carousel-inner">
          <div className="carousel-item active">
            <img src="..." className="d-block w-100" alt="..." />
          </div>
          <div className="carousel-item">
            <img src="..." className="d-block w-100" alt="..." />
          </div>
          <div className="carousel-item">
            <img src="..." className="d-block w-100" alt="..." />
          </div>
        </div>
        <a
          className="carousel-control-prev"
          href="#carouselExampleIndicators"
          role="button"
          data-slide="prev"
        >
          <span className="carousel-control-prev-icon" aria-hidden="true"></span>
          <span className="sr-only">Previous</span>
        </a>
        <a
          className="carousel-control-next"
          href="#carouselExampleIndicators"
          role="button"
          data-slide="next"
        >
          <span className="carousel-control-next-icon" aria-hidden="true"></span>
          <span className="sr-only">Next</span>
        </a>
      </div>
        <div className = "Container">
          <div className="Page">{nameListComponent()}</div>
        </div>
      </div>
    </React.Fragment>
  );
}

export default App;
